import './App.css';
import {
  BrowserRouter as Router, Route, Switch
} from 'react-router-dom';

import Home from './views/Home.jsx';
import Commitee from './views/Committee.jsx';

function App() {
  return (
      <Router>
      <Switch>
        <Route path="/">
          <Home />
        </Route>
        <Route exact path="/commitee">
          <Commitee />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
